"use strict";function __getuser_getLists(){var l=getParameterByName("id");$.ajax({url:Global.API_URL+"/user.json?id="+l,type:"GET",async:!0,dataType:"json",cache:!0,beforeSend:function(e){e.setRequestHeader("Authorization","Bearer "+localStorage.getItem("Token"))},error:function(e,t,a){},complete:function(e){var t=JSON.parse(e.responseText);for(var a in t)if(t.hasOwnProperty(a)){t[a].ObjectId;a===l&&(t=t[a])}var r=checkNull(t.email),s=checkNull(t.fullname),n=checkNull(t.username),c=md5(r);$("#Email").html(r),$("#FullName").html(s),$("#UserName").html(n),$("#avataruser").attr("src","https://www.gravatar.com/avatar/"+c+"?s=250")}})}$(document).ready(function(){__getuser_getLists()});